      out.write("\tvar idcardStr=\"\";\r\n");
      out.write("\tvar aCity={11:\"北京\",12:\"天津\",13:\"河北\",14:\"山西\",15:\"内蒙古\",21:\"辽宁\",22:\"吉林\",23:\"黑龙江\",31:\"上海\",32:\"江苏\",33:\"浙江\",34:\"安徽\",35:\"福建\",36:\"江西\",37:\"山东\",41:\"河南\",42:\"湖北\",43:\"湖南\",44:\"广东\",45:\"广西\",46:\"海南\",50:\"重庆\",51:\"四川\",52:\"贵州\",53:\"云南\",54:\"西藏\",61:\"陕西\",62:\"甘肃\",63:\"青海\",64:\"宁夏\",65:\"新疆\",71:\"台湾\",81:\"香港\",82:\"澳门\",91:\"国外\"}\r\n");
      out.write("\tfunction cidInfo(sId){\r\n");
      out.write("\t\tif(sId.length==15)\r\n");
      out.write("\t\t{\r\n");
      out.write("\t\t sId = sId.replace(/([\\d]{6})(\\d{9})/,\"$119$2x\");\r\n");
      out.write("\t\t}\r\n");
      out.write("\t\t var iSum=0\r\n");
      out.write("\t\t var info=\"\"\r\n");
      out.write("\t\t if(\"\" == sId) return true;\r\n");
      out.write("\t\t if(!/^\\d{17}(\\d|x)$/i.test(sId))return \"Error:身份证错误\";\r\n");
      out.write("\t\t sId=sId.replace(/x$/i,\"a\");\r\n");
      out.write("\t\t if(aCity[parseInt(sId.substr(0,2))]==null)return \"Error:非法地区\";\r\n");
