      out.write("\t\t var province = sId.substr(0,2)+\"0000\";\r\n");
      out.write("\t\t var city = sId.substr(0,2) + sId.substr(2,2) +\"00\";\r\n");
      out.write("\t\t idcardStr = {\"brithdate\" : sBirthday,\"sex\" : sId.substr(16,1)%2?\"男\":\"女\",\"province\":province,\"city\" : city};\r\n");
      out.write("\t\t return true;\r\n");
      out.write("\t}\r\n");
